import './App.css';
import {useState} from 'react';

function App() {
  const[raw,setraw] = useState(0);
  function incrementchangeHandler(){
      setraw(raw+1);
  }

  function decrementchangeHandler(){
      setraw(raw-1);
  }

  function submitHandler(){
    setraw(0);
  }

  return (
    <div className="App">
        <h1>Increment & Decrement </h1>

        <div className="pro" >
          <button onClick={decrementchangeHandler} className='btn'>-</button>

          <div className="val" > {raw} </div>

          <button onClick={incrementchangeHandler} className='btn'>+</button>
        </div>

        <button onClick={submitHandler} className='btn1' >Reset</button>
    </div>
  );
}

export default App;
